public int instrumentedSort(int[] list){ 
  int count = 0;  
  for(int i = 1; i < list.length; i++) { 
    int temp = list[i]; 
    int j = i; 
    while( j > 0 && temp < list[j - 1]) { 
      list[j] = list[j - 1]; 
      list[j - 1] = temp; 
      j--; 
      count++; 
    } 
  } 
  return count; 
} 
