public int explore(int tgt, int r, int c,  
int[][] mat) {
  int total = 0; 
  if(0 <= r && r < mat.length  
      && 0 <= c && c < mat[0].length){

    int[] rd = {-1, -1, 1, 1}; 
    int[] cd = {-1, 1, -1, 1}; 
    if( mat[r][c] == tgt ) { 
      mat[r][c]--; 
      total++; 
      for(int i = 0; i < 4; i++){ 
        int nr = r + rd[i]; 
        int nc = c + cd[i]; 
        total += explore(tgt, nr, nc, mat);
      } 
    } 
  } 
  return total; 
}   
